const input = ""

function reactPolymer(str) {
  let replacement = false;
  for (let i = 0; i < str.length - 1; i++) {
    if (str[i] !== str[i + 1] && (str[i] === str[i + 1].toUpperCase() || str[i].toUpperCase() === str[i + 1])) {
      str = str.replace(`${str[i]}${str[i + 1]}`, "");
			replacement = true;
    }
  }
 
  if (replacement === false) return str;
  return reactPolymer(str);
}
console.log(reactPolymer(input).length);

const shortestPolymerLength = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z'].reduce((acc, curr) => {
  const reactedLength = reactPolymer(input.replace(new RegExp(curr, "gi"), "")).length;
  return (acc < reactedLength) ? acc : reactedLength;
}, Number.MAX_VALUE);

console.log(shortestPolymerLength);
